import React from 'react';

import Parallax from 'react-parallax';

import { Grid } from '@material-ui/core';

import Image from './imgs/background.png';

const Jumbotron = () => {

    return (
        <Grid item xs={12}>

            <Parallax
                bgImage={Image}
                bgImageAlt="Jumbotron"
                strength={200}
            >
                <div style={{height: '50vh'}}></div>
            </Parallax>

        </Grid>
    );
};

export default Jumbotron;
